import React from 'react';
import logo5 from '../images/twiter.jpg'

class Navbar extends React.Component {
	render() {
		return (
			<nav className=" bg-light container">
				<div className="container-fluid">

                    <div className="navbar-brand col-1">
                        <h6>HOME</h6>
                    </div>
                    <div className="navbar-brand col-2">
                        <h6>Notificacions</h6>
                    </div>
                    <div className="navbar-brand col-2">
                        <h6>Discover</h6>
                    </div>
                    <div className="navbar-brand col-4">
                        <h6>Me</h6>
                    </div>
					<div className="navbar-brand col-1">
                       <img src=""></img>
                    </div>
				</div>
			</nav>
		);
	}
}

export default Navbar;
